// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Staking {
    address public owner;

    struct Position {
        uint256 positionId;
        address walletAddress;
        uint256 createdDate;
        uint256 unlockedDate;
        uint256 percentInterest;
        uint256 weiStaked;
        uint256 weiInterest;
        bool open;
    }

    Position position;

    uint256 public currentPositionId;
    mapping(uint256 => Position) public positions;
    mapping(address => uint256[]) public positionIdsByAddress;
    mapping(uint256 => uint256) public tiers;
    uint256[] public lockPeriods;

    constructor() payable {
        owner = msg.sender;
        currentPositionId = 0;

        //interest rates for each period
        tiers[30] = 700;
        tiers[90] = 1000;
        tiers[180] = 1200;

        lockPeriods.push(30);
        lockPeriods.push(90);
        lockPeriods.push(180);
    }

    function stakeEther(uint256 numDays) external payable {
        require(tiers[numDays] > 0, "Mapping not found.");

        positions[currentPositionId] = Position(
            currentPositionId,
            msg.sender,
            block.timestamp,
            block.timestamp + (numDays * 1 days),
            tiers[numDays],
            msg.value,
            calculateInterest(tiers[numDays], numDays, msg.value),
            true
        );

        positionIdsByAddress[msg.sender].push(currentPositionId);

        currentPositionId++;
    }

    function calculateInterest(
        uint256 basisPoints,
        uint256 numDays,
        uint256 weiAmount
    ) private pure returns (uint256) {
        //pure = doesn't touch the blockchain only outputs something
        return (basisPoints * weiAmount) / 10000;
    }

    function modifyLockPeriod(uint256 numDays, uint256 basisPoints) external {
        require(owner == msg.sender, "only owner can mofidy staking period.");
        if (numDays != 30 || numDays != 90 || numDays != 180) {
            tiers[numDays] = basisPoints;
        }
        lockPeriods.push(numDays);
    }

    function getLockPeriods() external view returns (uint256[] memory) {
        return lockPeriods;
    }

    function getInterestRate(uint256 numDays) external view returns (uint256) {
        return tiers[numDays];
    }

    function getPositionId(uint256 positionId)
        external
        view
        returns (Position memory)
    {
        return positions[positionId];
    }

    function getPositionIdForAddress(address walletAddress)
        external
        view
        returns (uint256[] memory)
    {
        return positionIdsByAddress[walletAddress];
    }

    function changeUnlockDate(uint256 positionId, uint256 newUnlockDate)
        external
    {
        require(owner == msg.sender, "only owner can mofidy staking period.");

        positions[positionId].unlockedDate = newUnlockDate;
    }

    function closePosition(uint256 positionId) external {
        require(
            positions[positionId].walletAddress == msg.sender,
            "Only Staker can modify position"
        );
        require(positions[positionId].open == true, "Posiont is closed.");

        positions[positionId].open = false;

        uint256 amount;

        if (block.timestamp > positions[positionId].unlockedDate) {
            amount =
                positions[positionId].weiStaked +
                positions[positionId].weiInterest;
        } else {
            amount = positions[positionId].weiStaked;
        }
        payable(msg.sender).call{value: amount}("");
    }
}

